SF.pl.boss_key = new SF.plugin((function($) {
    
    var excel_style = 
            'body{background-color: #fff;' +
            'background-image:url("data:image/png;base64,");' +
            'background-repeat:no-repeat;background-attachment:fixed;' +
            'background-position:top left;color:#333}' +
            'a,#sidebar a:hover,.pagination .more:hover,.stamp a:hover,' +
            '.light .stamp a{color:#666}' +
            'a:hover,.light .stamp .reply a{background-color:#666}' +
            'a:hover .label,a.photo:hover img,.stamp a:hover,.light .stamp a' +
            '{border-color:#666}.actions .open-notice:hover{color:#666}' +
            '#sidebar{background-color:#fff;border-left:1px solid #e5e5e5}' +
            '#sidebar .sect{border-top-color:#e5e5e5}' +
            '#sidebar .stabs{border-bottom-color:#e5e5e5}' +
            '#sidebar .stabs li.current a{color:#333}' +
            '#user_stats li{border-left-color:#e5e5e5}' +
            '#user_stats .count{color:#333}' +
            '#user_stats a:hover .count{color:#666}' +
            '#goodapp span{color:#333}' +
            '#header{height:91px}#navigation{margin-top:18px;}' +
            '.ui-roundedbox-corner,.ui-roundedbox-tl{position:static;margin:0!important;background:transparent!important;}' +
            '.ui-roundedbox-content{padding:0!important;background:transparent!important;}' +
            '#header h1{display:none;}' +
            '#stream li a.avatar,#stream li a.photo,#user_top img,#friends{opacity:.1}#stream li.light a.avatar,#stream li.light a.photo,#user_top img:hover,#friends:hover{opacity:1}' +
            '#info #avatar{display:none;}#panel{margin-left:5px!important;}' +
            '.slogan{color:transparent!important;font-size:0!important;}.slogan::before{color:#666;font-size:16px;content:"插入新公式";}';

    return {
        load: function() {
            var class_name = 'sf_excel_theme';
            var $toggle = $('<a />').attr('id', 'sf_boss_key')
    		                        .attr('title', '切换饭否默认模板 / 用户自定义模板')
    		                        .attr('href', '#').text('使用饭否默认模板')
    		                        .click(function(e) {
    		                              e.preventDefault();
    		                              if ($toggle.hasClass(class_name)) {
    		                                  $('#sf_excel_theme').remove();
    		                                  $toggle.text('使用饭否默认模板');
    		                              } else {
    		                                  $('<style />').attr('id', 'sf_excel_theme')
    		                                  .html(excel_style).insertAfter('head style');
    		                                  $toggle.text('使用用户自定义模板');
    		                              }
    		                              $toggle.toggleClass(class_name);
    		                         })
    		                         .appendTo('body');
        },
        unload: function() {
            $('#sf_excel_theme').add('#sf_excel_theme').remove();
        }
    };
})(jQuery));
